import React from "react";
import { Line } from "react-chartjs-2";

function LineGraph({ xData, yData }) {
  const data = {
    labels: xData,
    datasets: [
      {
        label: "Line Graph",
        data: yData,
        fill: false,
        borderColor: "rgba(75,192,192,1)",
        tension: 0.1,
      },
    ],
    options: {
      responsive: true,
      maintainAspectRatio: false,
    },
  };

  return (
    <div>
      <h2>Line Graph</h2>
      <Line data={data} />
    </div>
  );
}

export default LineGraph;
